    @Test
    public void hexEncodeTest()
    {
        String[] resultArray = new String[SKUS_AS_STRING.length];
        for (int i = 0; i < SKUS_AS_STRING.length; i++)
        {
            String encryptedString = TextUtil.encodeHex(SKUS_AS_STRING[i].getBytes());
            // System.out.println(SKUS[i] + ": " + encryptedString);
            resultArray[i] = encryptedString;
        }
        Assert.assertTrue(Arrays.equals(resultArray, SKUS_AS_HEX));
    }

    @Test
    public void hexDecodeTest()
    {
        String[] resultArray = new String[SKUS_AS_HEX.length];
        for (int i = 0; i < SKUS_AS_HEX.length; i++)
        {
            String decryptedString = TextUtil.decodeHex(SKUS_AS_HEX[i].toCharArray());
            // System.out.println(SKUS_HEX[i] + ": " +decryptedString);
            resultArray[i] = decryptedString;
        }
        Assert.assertTrue(Arrays.equals(resultArray, SKUS_AS_STRING));

    }
